import React from 'react';
import { Link } from 'react-router-dom';
import '../styles.css';

const Home = () => {
  return (
    <div className="home-container">
      <h1>Bienvenido a la Carga de Archivos</h1>
      <div className="button-container">
        <Link to="/carga-reloj" className="button">Carga Reloj</Link>
        <Link to="/carga-horario" className="button">Carga Horario</Link>
        <Link to="#" className="button">Botón No Funcional</Link> {/* Botón no funcional */}
      </div>
    </div>
  );
};

export default Home;
